import React from 'react';
import "../App.css"

const Navbar = () => {
  return (
    <div className="relative bg-purple-800 text-white">
    <header className="container ">
      <nav className="flex flex-cols items-center  bg-purple-600 py-4 px-12 w-[100vw] ">
      <h2 className='title'>Car_inventory</h2>
        <ul className="flex">
          <a href="#" className="ml-4">Add Car </a>
          <a href="#" className="ml-4">Update Car </a>
          <a href="#" className="ml-4">Delete Car </a>

        </ul>
      </nav>
    </header>
  </div>

  );
};

export default Navbar;
